import React from 'react';
import ContactMe from '../contactMe/index';
import './styles.css';

const HomePage = () => {
    return (
        <>
        <div className="selfImage">
            <img alt="timer" src={require('./self.jpg')} />
        </div>
        <h1>Paula Martinez Garcia</h1>
        <ContactMe />
        <p>PAGE UNDER CONSTRUCTION</p>
        </>
    );
};

export default HomePage;
